import { Link } from 'react-router-dom'

import './navBarStyle.css';

export const NavBar = () => {

  return (

    <div className = 'myNavBar'>

        <Link className = 'navLink myRoutes' to='/home'> Mis rutas </Link>

        <Link className = 'navLink newRoute' to='/newRoute'> Agregar nueva ruta </Link>

        <Link className = 'navLink completedRoute' to='/completed'> Rutas completadas </Link>

        <Link className = 'navLink trashRoute' to='/trash'> Papelera </Link>
   
    </div>

  )
}
